INSERT INTO `custom_page` (`id`, `title`, `alias`, `content`, `created_at`, `author_id`, `updated_at`, `updated_author_id`, `tags`, `metadesc`, `metakeys`, `visible`, `status`) VALUES
(1, 'Cara Beli', 'cara-beli', '<div class="stitle" style="color: #666666; margin-top: 15px; font-size: 14px; width: 530px;">\r\n	Berbelanja di <a href="http://beegros.com" style="color: #4d91ec;">beegros.com</a> sangatlah mudah, bisa order dengan berbagai cara baik website, telepon, sms, bbm, atau e-mail.</div>\r\n<div class="email" style="margin-top: 15px; color: #4d91ec; font-size: 13px; width: 550px; height: 100px;">\r\n	<div class="email-left" style="width: 100px; height: 100px; float: left;">\r\n		<img alt="" border="0" class="b-email" height="98" src="&lt;?php echo imageUrl(''pages/b-email1.jpg''); ?&gt;" width="98" /></div>\r\n	<div class="email-right" style="margin-left: 15px; width: 435px; height: 100px; float: left;">\r\n		<div class="subtitle" style="margin: 0px; color: #4d91ec; font-size: 14px; width: 435px; &lt;br /&gt;&lt;br /&gt;&lt;br /&gt; height: 20px;">\r\n			1. E-mail</div>\r\n		<div class="subtext" style="color: #666666; font-size: 13px; margin-left: 15px; margin-top: 5px width: 400px; height: 75px;">\r\n			Cantumkan Nama, Alamat Pengiriman, No HP, Order dan kirim ke <a href="mailto:order@beegros.com" style="font-size: 18px; color: magenta; ">order@beegros.com</a> atau Hubungi Costumer Service kami melalui YM Customer Support kami.</div>\r\n	</div>\r\n</div>\r\n<div class="phone" style="margin-top: 15px; color: #4d91ec; font-size: 13px; width: 550px; height: 100px;">\r\n	<div class="phone-left" style="width: 100px; height: 100px; float: left;">\r\n		<img alt="" border="0" class="b-email" height="98" src="&lt;?php echo imageUrl(''pages/b-phone1.jpg''); ?&gt;" width="98" /></div>\r\n	<div class="phone-right" style="margin-left: 15px; width: 435px; height: 100px; float: left;">\r\n		<div class="subtitle" style="margin: 0px; color: #4d91ec; font-size: 14px; width: 435px; &lt;br /&gt;&lt;br /&gt;&lt;br /&gt; height: 20px;">\r\n			2. Hotline Telepon dan SMS</div>\r\n		<div class="subtext" style="color: #666666; font-size: 13px; margin-left: 15px; margin-top: 5px width: 400px; height: 75px;">\r\n			Tinggal hubungi kami di Hotline Service (022)8428 1480 dan SMS 0878-0-2000-300. Kami siap membantu Anda untuk berbelanja.</div>\r\n	</div>\r\n</div>\r\n<div class="langsung" style="margin-top: 15px; color: #4d91ec; font-size: 13px; width: 550px; height: 100px;">\r\n	<div class="langsung-left" style="width: 100px; height: 100px; float: left;">\r\n		<img alt="" border="0" class="b-email" height="98" src="&lt;?php echo imageUrl(''pages/b-langsung1.jpg''); ?&gt;" width="98" /></div>\r\n	<div class="langsung-right" style="margin-left: 15px; width: 435px; height: 100px; float: left;">\r\n		<div class="subtitle" style="margin: 0px; color: #4d91ec; font-size: 14px; width: 435px; &lt;br /&gt;&lt;br /&gt;&lt;br /&gt; height: 20px;">\r\n			3. Belanja dengan Kunjungan Langsung</div>\r\n		<div class="subtext" style="color: #666666; font-size: 13px; margin-left: 15px; margin-top: 5px width: 400px; height: 75px;">\r\n			Alamat: Jl Durman no.24A, Bandung<br />\r\n			Mohon konfirmasi kunjungan Anda ke Costumer Service kami agar bisa menyiapkan barang yang ingin Anda beli.</div>\r\n	</div>\r\n</div>\r\n<div class="web" style="margin-top: 15px; color: #4d91ec; font-size: 13px; width: 550px; height: 100px;">\r\n	<div class="web-left" style="width: 100px; height: 100px; float: left;">\r\n		<img alt="" border="0" class="b-email" height="98" src="&lt;?php echo imageUrl(''pages/b-web1.jpg''); ?&gt;" width="98" /></div>\r\n	<div class="web-right" style="margin-left: 15px; width: 435px; height: 100px; float: left;">\r\n		<div class="subtitle" style="margin: 0px; color: #4d91ec; font-size: 14px; width: 435px; &lt;br /&gt;&lt;br /&gt;&lt;br /&gt; height: 20px;">\r\n			4. Web dengan Add To Cart</div>\r\n		<div class="subtext" style="color: #666666; font-size: 13px; margin-left: 15px; margin-top: 5px width: 400px; height: 75px;">\r\n			Pilih barang yang diingini, add to cart, checkout, lalu isi info Billing Address dan Shipping Address dan pilih metode pembayaran Direct Transfer atau Check Payment.</div>\r\n	</div>\r\n</div>\r\n<div class="bbm" style="margin-top: 15px; color: #4d91ec; font-size: 13px; width: 550px; height: 100px;">\r\n	<div class="bbm-left" style="width: 100px; height: 100px; float: left;">\r\n		<img alt="" border="0" class="b-email" height="98" src="&lt;?php echo imageUrl(''pages/b-bbm1.jpg''); ?&gt;" width="98" /></div>\r\n	<div class="bbm-right" style="margin-left: 15px; width: 435px; height: 100px; float: left;">\r\n		<div class="subtitle" style="margin: 0px; color: #4d91ec; font-size: 14px; width: 435px; &lt;br /&gt;&lt;br /&gt;&lt;br /&gt; height: 20px;">\r\n			5. Blackberry Messenger (BBM)</div>\r\n		<div class="subtext" style="color: #666666; font-size: 13px; margin-left: 15px; margin-top: 5px width: 400px; height: 75px;">\r\n			Hubungi Customer Service kami di BBM, dengan add pin BB kami:\r\n			<p>\r\n				Retail: 53659856</p>\r\n			<p>\r\n				Grosir: 330DC05E</p>\r\n		</div>\r\n	</div>\r\n</div>\r\n<div class="setelah" style="margin-top: 15px; color: #4d91ec; font-size: 14px; width: 500px; &lt;br /&gt;&lt;br /&gt;&lt;br /&gt; height: 20px;">\r\n	Setelah order dibuat, pembayaran bisa dilakukan ke rekening berikut :</div>\r\n<div class="rekening" style="margin-top: 15px; color: #666666; font-size: 13px; width: 550px; height: 100px;">\r\n	<div class="rekening-left" style="width: 100px; height: 100px; float: left;">\r\n		<img alt="" border="0" class="b-rekening" height="98" src="&lt;?php echo imageUrl(''pages/b-rekening1.jpg''); ?&gt;" width="98" /></div>\r\n	<div class="rekening-right">\r\n		<div class="alamat" style="color: #666666; font-size: 13px; margin-left: 10px; margin-top: 5px; width: 450px; height: 25px;">\r\n			Account Name : <b>Mohamad Firman Nurimansyah</b></div>\r\n		<div>\r\n			BCA &ndash; 810 0289 921<br />\r\n			MANDIRI &ndash; 13000-13000-404</div>\r\n	</div>\r\n</div>\r\n<div class="confirm" style="margin-top: 15px; color: #666666; font-size: 13px; width: 550px; height: 100px;">\r\n	<div class="confirm-left" style="width: 100px; height: 100px; float: left;">\r\n		<img alt="" border="0" class="b-rekening" height="98" src="&lt;?php echo imageUrl(''pages/b-confirm1.jpg''); ?&gt;" width="98" /></div>\r\n	<div class="confirm-right">\r\n		<div style="margin-top: 30px; margin-left: 10px;">\r\n			Setelah melakukan pembayaran, jangan lupa konfirmasi pembayaran ke Costumer Service kami.</div>\r\n	</div>\r\n</div>\r\n<div class="truck" style="margin-top: 15px; color: #666666; font-size: 13px; width: 550px; height: 100px;">\r\n	<div class="truck-left" style="width: 100px; height: 100px; float: left;">\r\n		<img alt="" border="0" class="b-rekening" height="98" src="&lt;?php echo imageUrl(''pages/b-truck1.jpg''); ?&gt;" width="98" /></div>\r\n	<div class="truck-right">\r\n		<div style="margin-top: 30px; margin-left: 10px;">\r\n			Sehabis pembayaran tunggu barang yang telah dipesan dikirim ke alamat rumah anda. Selamat Berbelanja =)</div>\r\n	</div>\r\n</div>\r\n', 1423776348, 1, 0, 0, '', '', '', 'admin', 1),
(2, 'Tentang Kami', 'tentang-kami', '<p>\r\n	Kami adalah online</p>\r\n', 1423776558, 1, 0, 0, '', '', '', 'admin', 1),
(3, 'FAQ', 'faq', '<p>\r\n	FAQ</p>\r\n', 1423776976, 1, 0, 0, '', '', '', 'admin', 1);
