CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_count_total_workdays`(IN `p_periode_start` DATE, IN `p_periode_end` DATE)
BEGIN

	DECLARE v_start DATE;
    
    DROP TEMPORARY TABLE IF EXISTS work_days;
    CREATE TEMPORARY TABLE work_days
    (
        `date` DATE,
        `weekday` VARCHAR(15)
    ) ENGINE=MEMORY;
    
    SET v_start = p_periode_start;
    
    WHILE v_start <= p_periode_end DO
    
        SET v_start = DATE_ADD(v_start, INTERVAL 1 DAY);
    
    END WHILE;
    
    
    UPDATE work_days SET `weekday` = WEEKDAY(`date`);
    SELECT count(*) AS JML FROM work_days WHERE `weekday` < 6 AND `date` NOT IN (SELECT `date` FROM `payroll_holiday_pay`);

END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_cron_daily`()
BEGIN

