	WHERE status = 'approved' AND v_cur_date BETWEEN date_start AND date_end;

END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_cron_monthly_01`()
BEGIN

	-- Update + 1 jatah cuti karyawan tetap (Jobholder) yang sudah 18 bulan bekerja, dan RESET total cuti dalam bulan tersebut
