CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_employee_new_record`(IN `p_employee_id` INT, IN `p_year` INT, IN `p_user_id` INT)
BEGIN

	DECLARE v_code VARCHAR(15);
    DECLARE v_hiredate DATE;
    DECLARE v_department_id, v_section_id, v_position_id, v_outlet_id, v_level_id, v_grade_id, v_city_id, v_salary_id INT;
    DECLARE v_yos INT;
    DECLARE v_message VARCHAR(512);
    
    
    SET v_message = '';
    
    -- Get employee informations
    SELECT `code`, hiredate, department_id, section_id, position_id, outlet_id, level_id, grade_id, city_area_id
	INTO v_code, v_hiredate, v_department_id, v_section_id, v_position_id, v_outlet_id, v_level_id, v_grade_id, v_city_id
    FROM `masters_employees`
    WHERE id = p_employee_id;
    
      
    -- Get years of service in MONTHS
    SET v_yos = TIMESTAMPDIFF(MONTH, DATE_FORMAT(v_hiredate,'%Y-%m-%d'), DATE_FORMAT(now(),'%Y-%m-%d'));
    
    
    -- Add additional info
    VALUES (p_employee_id, v_yos, 0, 0, 0);


	-- Add position track
    -- * Get salary Id
    SELECT id INTO v_salary_id FROM `payroll_based_salaries`
    WHERE `year` = p_year AND city_id = v_city_id AND department_id = v_department_id AND 
		section_id = v_section_id AND position_id = v_position_id AND level_id = v_level_id AND grade_id = v_grade_id AND years_of_service_start <= v_yos AND years_of_service_end >= v_yos;
    
    VALUES (p_employee_id, v_hiredate, p_year, v_city_id, v_department_id, v_section_id, v_position_id, v_outlet_id, v_level_id, v_grade_id, v_yos, v_salary_id, p_user_id);
    
    IF v_salary_id = NULL THEN
    
    	IF v_message <> '' THEN
        	SET v_message = v_message + ';';
        END IF;
        
        SET v_message = v_message + 'Data matriks salary untuk karyawan dengan NIK ' + v_code + ' tidak ditemukan';
    
    END IF;
    
    
    SELECT v_message;

END$$

