CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_payroll_payment_generate`(IN `p_periode_id` INT, IN `p_department_id` VARCHAR(11), IN `p_outlet_id` VARCHAR(11), IN `p_status` INT, IN `p_user_id` INT)
BEGIN

	DECLARE v_month TINYINT;
    DECLARE v_year INT(11);
    
    
    /* Get payroll periode */
    SELECT `year`, `month` INTO v_year, v_month
    FROM `payroll_salary_periode_history`
    WHERE id = p_periode_id;
    

	SELECT DISTINCT employee_id, `year`, month, p_user_id, 'transfer', 'new'
    FROM `attendance_presences_monthly_recap` A INNER JOIN `masters_employees` B ON A.employee_id = B.id
    WHERE A.`year` = v_year AND A.`month` = v_month AND B.department_id LIKE p_department_id AND B.outlet_id LIKE p_outlet_id;
    

    SELECT Y.id AS payment_id, A.id AS recap_id, C.basic_salary_from + IF (D.basic_salary IS NULL, 0, basic_salary) AS basic_salary, 0, 0 
    FROM `payroll_employee_payments` Y INNER JOIN `attendance_presences_monthly_recap` A ON Y.employee_id = A.employee_id AND Y.`year` = A.`year` AND Y.month = A.month 
		INNER JOIN `masters_employee_position_track` B ON A.position_track_id = B.id 
    	INNER JOIN `payroll_based_salaries` C ON B.salary_id = C.id
		LEFT JOIN `payroll_employee_salary` D ON A.employee_id = D.employee_id
    WHERE A.`year` = v_year AND A.`month` = v_month AND A.employee_id IN (SELECT id FROM `masters_employees` WHERE department_id LIKE p_department_id AND outlet_id LIKE p_outlet_id);
    
    
    SELECT Y.id AS payment_id, Z.id AS payment_salary_id, C.allowance_id, C.values + IF (D.values IS NULL, 0, D.values) AS `values`
	FROM `payroll_employee_payments` Y 
		INNER JOIN `payroll_employee_payment_salaries` Z ON Y.id = Z.payment_id
    	INNER JOIN `attendance_presences_monthly_recap` A ON Z.recap_id = A.id 
		INNER JOIN `masters_employee_position_track` B ON A.position_track_id = B.id 
    	INNER JOIN `payroll_based_allowances` C ON B.salary_id = C.standard_id
		LEFT JOIN `payroll_employee_allowances` D ON B.salary_id = D.salary_id AND C.allowance_id = D.allowance_id
	WHERE A.`year` = v_year AND A.`month` = v_month AND A.employee_id IN (SELECT id FROM `masters_employees` WHERE department_id LIKE p_department_id AND outlet_id LIKE p_outlet_id);
    
    

END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_payroll_prepare`(IN `p_periode_id` INT)
BEGIN

	DECLARE v_periode_start, v_periode_end DATE;
    DECLARE v_total_holiday_x2, v_total_holiday_x3 TINYINT;
    
    SELECT `start`, `end` INTO v_periode_start, v_periode_end 
    FROM `payroll_salary_periode_history`
    WHERE id = p_periode_id;
    
    SELECT COUNT(*) INTO v_total_holiday_x2
    FROM `payroll_holiday_pay`
    WHERE `date` BETWEEN v_periode_start AND v_periode_end AND multiplier = 2;
    
    SELECT COUNT(*) INTO v_total_holiday_x3
    FROM `payroll_holiday_pay`
    WHERE `date` BETWEEN v_periode_start AND v_periode_end AND multiplier = 3;
    
    UPDATE `payroll_salary_periode_history` SET total_work_day = fc_total_workday(`start`, `end`), total_holiday_x2 = v_total_holiday_x2, total_holiday_x3 = v_total_holiday_x3
    WHERE id = p_periode_id;
    
    SELECT * FROM `payroll_salary_periode_history`
    WHERE id = p_periode_id;

END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_presences_recap_monthly_generate`(IN `p_periode_id` INT, IN `p_department_id` VARCHAR(11), IN `p_outlet_id` VARCHAR(11), IN `p_user_id` INT)
BEGIN

	DECLARE v_total_workday, v_month TINYINT;
    DECLARE v_year INT(11);
    DECLARE v_periode_start, v_periode_end DATE;
    
	
    DROP TEMPORARY TABLE IF EXISTS temp_presence_recap;
    CREATE TEMPORARY TABLE temp_presence_recap
    (
        employee_id INT(11),
        `date` DATE,
        type VARCHAR(10),
        presence_time DATETIME,
        is_late TINYINT,
        position_track_id INT(11),
        multiplier TINYINT
    ) ENGINE=MEMORY;
    
    DROP TEMPORARY TABLE IF EXISTS temp_presence_recap2;
    CREATE TEMPORARY TABLE temp_presence_recap2
    (
        employee_id INT(11),
        `date` DATE,
        type VARCHAR(10),
        presence_time DATETIME
    ) ENGINE=MEMORY;
    
    
    /* Get total work day in specific periode */
    SELECT `year`, `month`, `start`, `end`, total_work_day 
    INTO v_year, v_month, v_periode_start, v_periode_end, v_total_workday
    FROM `payroll_salary_periode_history`
    WHERE id = p_periode_id;
    
    
    /* Filtering duplicate data presence with same TYPE */
    SELECT employee_id, `date`, type, IF (type = 'CI', IF (check_in IS NULL, check_out, check_in), IF (type = 'LV', `leave`, IF (type = 'P', permit, IF (type = 'S', sick, IF (type = 'SN', sickwithoutmail, NULL))))) AS presence_time, is_late, position_track_id, 0
    FROM `attendance_presences_recap` 
    WHERE `date` BETWEEN v_periode_start AND v_periode_end 
    	AND employee_id IN (SELECT id FROM `masters_employees` WHERE department_id LIKE p_department_id AND outlet_id LIKE p_outlet_id);
    
    
    SELECT employee_id, `date`, type, MIN(presence_time) AS presence_time
    FROM temp_presence_recap
    GROUP BY employee_id, `date`, type;
    
    
    DELETE A.* FROM temp_presence_recap A INNER JOIN 
    	temp_presence_recap2 B ON A.employee_id = B.employee_id AND A.`date` = B.`date` AND A.type = B.type AND A.presence_time > B.presence_time;
    
    
    
    /* Update multiplier holiday date */
    UPDATE temp_presence_recap A INNER JOIN payroll_holiday_pay B ON A.`date` = B.`date`
    SET A.multiplier = B.multiplier;
    
    
    DELETE FROM `attendance_presences_monthly_recap`
    WHERE `year` = v_year AND `month` = v_month AND employee_id IN (SELECT id FROM `masters_employees` WHERE department_id LIKE p_department_id AND outlet_id LIKE p_outlet_id);
    
   
    SELECT employee_id, position_track_id, v_year, v_month, total_in, total_in_x2, total_in_x3, total_leave, total_permit, total_sick, total_sick_withoutmail, CASE WHEN v_total_workday - (total_in + total_leave + total_permit + total_sick + total_sick_withoutmail) < 0 THEN 0 ELSE v_total_workday - (total_in + total_leave + total_permit + total_sick + total_sick_withoutmail) END AS total_alpha, total_late, total_in + total_leave + total_permit + total_sick + total_sick_withoutmail AS total_workday, v_total_workday AS current_workday, p_user_id
    FROM (SELECT employee_id, position_track_id, v_year, v_month
    	, SUM(CASE WHEN type = 'CI' THEN 1 ELSE 0 END) AS total_in
    	, SUM(CASE WHEN type = 'CI' AND multiplier = 2 THEN 1 ELSE 0 END) AS total_in_x2
    	, SUM(CASE WHEN type = 'CI' AND multiplier = 3 THEN 1 ELSE 0 END) AS total_in_x3
    	, SUM(CASE WHEN type = 'LV' THEN 1 ELSE 0 END) AS total_leave
    	, SUM(CASE WHEN type = 'P' THEN 1 ELSE 0 END) AS total_permit
    	, SUM(CASE WHEN type = 'S' THEN 1 ELSE 0 END) AS total_sick
    	, SUM(CASE WHEN type = 'SN' THEN 1 ELSE 0 END) AS total_sick_withoutmail
    	, SUM(is_late) AS total_late
    	FROM temp_presence_recap
    	GROUP BY employee_id, position_track_id) A
    ORDER BY employee_id, position_track_id;
    
    
    
    SELECT * FROM `attendance_presences_monthly_recap` WHERE `year` = v_year AND `month` = v_month;
    
END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_presences_recap_update_track`(IN `p_periode_start` INT, IN `p_periode_end` INT)
BEGIN

	UPDATE `attendance_presences_recap` SET position_track_id = (SELECT MAX(id) AS id 
		FROM `masters_employee_position_track`
		WHERE employee_id = `attendance_presences_recap`.employee_id AND active_date <= `attendance_presences_recap`.date)
    WHERE date BETWEEN p_periode_start AND p_periode_end;

END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_recap_presences_generate`(IN `p_periode_start` DATE, IN `p_periode_end` DATE, IN `p_department_id` INT, IN `p_outlet_id` INT)
BEGIN
	
    DELETE FROM `attendance_presences_recap`
    WHERE `date` BETWEEN p_periode_start AND p_periode_end 
    	AND employee_id IN (SELECT `id` FROM `masters_employees` WHERE department_id = p_department_id AND outlet_id = p_outlet_id AND is_active = 1);
    
SELECT employee_id, shift_id, `date`, type
, `CheckIn`, `CheckOut`, `BreakOut`, `BreakIn`, `Leave`, `Permit`, `Sick`, `Sicknomail`, `Alpha`, time_check_in
, presence_total_hours(`CheckIn`, `CheckOut`, `BreakOut`, `BreakIn`, 1) as `total_hours`
, if(CAST(TIME_FORMAT(`CheckIn`, '%H:%i:%s') AS TIME) > time_check_in, 1, 0) as `islate`
, if(CAST(TIME_FORMAT(`CheckIn`, '%H:%i:%s') AS TIME) > time_check_in, TIMEDIFF(CAST(TIME_FORMAT(`CheckIn`, '%H:%i:%s') AS TIME), time_check_in), NULL) AS `latetime`
, now() AS `created_at`
FROM (SELECT A.employee_id, A.date
	, (case when A.shift_id IS NULL then 1 else A.shift_id end) AS shift_id
	, (case when type='CI' Or type='CO' Or type='BI' Or type='BO' then 'CI' else type end) AS type
	, min(case type when 'CI' then presence_date else NULL end) as `CheckIn`
	, max(case type when 'CO' then presence_date else NULL end) as `CheckOut`
	, min(case type when 'BO' then presence_date else NULL end) as `BreakOut`
	, max(case type when 'BI' then presence_date else NULL end) as `BreakIn`
	, min(case type when 'LV' then presence_date else NULL end) as `Leave`
	, min(case type when 'PM' then presence_date else NULL end) as `Permit`
	, min(case type when 'S' then presence_date else NULL end) as `Sick`
	, min(case type when 'SA' then presence_date else NULL end) as `Sicknomail`
	, min(case type when 'A' then presence_date else NULL end) as `Alpha`
	, D.time_check_in
	FROM `attendance_presences` A INNER JOIN `masters_employees` B ON A.employee_id = B.id
		INNER JOIN `masters_departments` C ON B.department_id = C.id
		INNER JOIN `reference_attendance_outlet_shifts` D ON A.shift_id = D.shift_id AND C.shift_format_id = D.format_id
	WHERE B.department_id = p_department_id AND B.outlet_id = p_outlet_id AND A.`date` BETWEEN p_periode_start AND p_periode_end
	GROUP BY A.employee_id, A.date, A.shift_id, (case when A.type='CI' Or A.type='CO' Or A.type='BI' Or A.type='BO' then 'CI' else A.type end), D.time_check_in) AS temp
order by `date`, employee_id, type;


	SELECT employee_id, CONCAT(B.firstname, '', B.lastname) AS `fullname`, shift_id, C.name AS `shift`, `date`, type, check_in, check_out, break_out, break_in, `leave`, permit, sick, sickwithoutmail, alpha, time_check_in, total_hours, is_late, late_time, created_at
	FROM `attendance_presences_recap` A INNER JOIN `masters_employees` B ON A.employee_id = B.id
		INNER JOIN `reference_attendance_shifts` C ON A.shift_id = C.id
    WHERE B.department_id = p_department_id AND B.outlet_id = p_outlet_id AND A.`date` BETWEEN p_periode_start AND p_periode_end
	ORDER BY CONCAT(B.firstname, '', B.lastname) ASC;
    
END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `tes`()
BEGIN

	DECLARE v_start DATE;
    DECLARE v_month INT;
    
    DROP TEMPORARY TABLE IF EXISTS work_days;
    CREATE TEMPORARY TABLE work_days
    (
        `date` DATE,
        `weekday` VARCHAR(15),
        `month` INT
    ) ENGINE=MEMORY;
    
    SET v_start = '2015-12-21';
    SET v_month = 1;
    
    WHILE v_start <= '2016-12-20' DO
    
        SET v_start = DATE_ADD(v_start, INTERVAL 1 DAY);
        IF DAY(v_start) = 21 THEN
        	SET v_month = v_month + 1;
        END IF;
    
    END WHILE;
    
    
    UPDATE work_days SET `weekday` = WEEKDAY(`date`);
    SELECT `month`, count(*) AS JML FROM work_days WHERE `weekday` < 6 GROUP BY `month`;
    SELECT * FROM work_days;

END$$

