CREATE DEFINER=`root`@`localhost` FUNCTION `fc_full_age`(`p_date` DATE, `p_view` VARCHAR(20)) RETURNS varchar(50) CHARSET latin1
BEGIN

	DECLARE v_year, v_month, v_day VARCHAR(4);

	SET v_year = CAST(FLOOR(( DATE_FORMAT(now(),'%Y%m%d') - DATE_FORMAT(p_date,'%Y%m%d'))/10000) AS CHAR(4));
    
    SET v_month = CAST(FLOOR((1200 + DATE_FORMAT(now(),'%m%d') - DATE_FORMAT(p_date,'%m%d'))/100) %12 AS CHAR(2));
    
	SET v_day = CAST(FLOOR((sign(day(now()) - day(p_date))+1)/2 * (day(now()) - day(p_date)) + (sign(day(p_date) - day(now()))+1)/2 * (DAY(STR_TO_DATE(DATE_FORMAT(p_date + INTERVAL 1 MONTH,'%Y-%m-01'),'%Y-%m-%d') - INTERVAL 1 DAY) - day(p_date) + day(now()))) AS CHAR(2));
    
    IF p_view = 'serialize' THEN
    	RETURN CONCAT('{"year":', v_year,',"month":', v_month,',"day":', v_day,'}');
    ELSE
    	RETURN CONCAT(v_year,' Thn ', v_month,' Bln ', v_day,' Hr');
    END IF;

END$$

CREATE DEFINER=`root`@`localhost` FUNCTION `fc_full_month`(`p_date` DATE) RETURNS smallint(6)
BEGIN

	RETURN TIMESTAMPDIFF(MONTH, DATE_FORMAT(p_date,'%Y-%m-%d'), DATE_FORMAT(now(),'%Y-%m-%d'));

END$$

CREATE DEFINER=`root`@`localhost` FUNCTION `fc_total_workday`(`p_periode_start` DATE, `p_periode_end` DATE) RETURNS tinyint(4)
BEGIN

	DECLARE v_start DATE;
    DECLARE v_total_workday TINYINT;
    
    DROP TEMPORARY TABLE IF EXISTS work_days;
    CREATE TEMPORARY TABLE work_days
    (
        `date` DATE,
        `weekday` VARCHAR(15)
    ) ENGINE=MEMORY;
    
    SET v_start = p_periode_start;
    
    WHILE v_start <= p_periode_end DO
    
        SET v_start = DATE_ADD(v_start, INTERVAL 1 DAY);
    
    END WHILE;
    
    
    UPDATE work_days SET `weekday` = WEEKDAY(`date`);
    SELECT count(*) INTO v_total_workday FROM work_days WHERE `weekday` < 6 AND `date` NOT IN (SELECT `date` FROM `payroll_holiday_pay`);
    
    RETURN v_total_workday;

END$$

CREATE DEFINER=`root`@`localhost` FUNCTION `presence_total_hours`(`p_check_in` DATETIME, `p_check_out` DATETIME, `p_break_out` DATETIME, `p_break_in` DATETIME, `p_format_type` SMALLINT) RETURNS time
BEGIN
DECLARE long_hours TIME;

IF p_format_type <= 1 THEN
	SET long_hours = TIMEDIFF(p_check_out, p_check_in);
ELSE 
	SET long_hours = ADDTIME(TIMEDIFF(p_break_out, p_check_in), TIMEDIFF(p_check_out, p_break_in));
END IF;

RETURN (long_hours);
END$$

