--
-- Trigger `leave_request`
--
DELIMITER //
CREATE TRIGGER `tiger_approve_leaves` AFTER UPDATE ON `leave_request`
 FOR EACH ROW BEGIN

	DECLARE v_start DATE;

	IF NEW.status = "approved" THEN
    
    	SET v_start = NEW.date_start;
    	WHILE v_start <= NEW.date_end DO
        	
        	SELECT NEW.employee_id, v_start, 'LV', NOW();
            
            SET v_start = DATE_ADD(v_start, INTERVAL 1 DAY);
            
        END WHILE;
    
    END IF;

END
//
DELIMITER ;

